using namespace std;
bool canChange(string start, string target) 
{
    int n = start.size(),i = 0,j = 1,k = 0;
    if(n<=1 && start[0]==target[0]) return true;
    while(i<n &&j<n)
    {
        if(start[i]==target[i])
        {
            i++;
            j=i+1;
        }
        else if(((start[i]=='_' && start[j]=='L') || (start[i]=='R' && start[j]=='_')))
        {
            swap(start[i],start[j]);
            i++;
            j++;
        }
        else if((start[i]=='R' && start[j]=='R') || (start[i]=='L' && start[j]=='L')) 
        j++;
        else if((start[i]=='_' && start[j]=='_')) 
        j++;
        else i++;
        if(start==target) break;
    }
    cout<<start<<endl;
    cout<<target<<endl;
    return (start==target)?true:false;
}
